import './App.css';
import Login from "./components/Login";
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
   <Router>
     <Switch>
       <Route exact path="/" component={Login}/>
     </Switch>
   </Router>
  );
}

export default App;
